$(document).ready(function() {
    $.ajax({
      url: "https://formacitron.github.io/shopslist/shops.json",
      method: "GET",
      dataType: "json",
      success: function(data) {
        
        console.log(data);
        
        data.shops.forEach(function(shop) {
          console.log(shop.nom);
        });
      },
      error: function(error) {
        console.log("Erreur lors de la récupération des données des magasins");
      }
    });
  });
